import React, { useState } from "react";
import { Blob } from "blob";

const Temp = () => {
  const [blob] = useState(new Blob([fileSystem.readFileSync("/path/to/image.jpeg")], { type: "image/jpeg" }));

  return (
    <div>
      <img src={blob} alt="Image" />
    </div>
  );
};

export default Temp;
